css:
.nuclide-side-bar-tab-container {
  display: flex;
  flex: 1;
  flex-direction: column;
  min-width: 0;
}
/* Ensure consistent tab padding in One Dark/Light themes */
.theme-one-dark-ui .nuclide-side-bar-tab-container,
.theme-one-light-ui .nuclide-side-bar-tab-container {
  padding-top: 0.5em;
}
@media (max-width: 1000px), (max-height: 600px) {
  [theme-one-light-ui-layoutmode="auto"] .nuclide-side-bar-tab-container,
  [theme-one-dark-ui-layoutmode="auto"] .nuclide-side-bar-tab-container {
    padding-top: 0;
  }
}
